export class Parameters{constructor(a={}){this.panDiameter=1,this.panSpeedRPM=5,this.atomizationAir=45,this.patternAir=45,this.sprayPatternWidth=.1778,this.sprayRatePerGun=100,this.gunToBed=.2032,Object.getOwnPropertyNames(this).map(b=>{a[b]&&(this[b]=a[b])})}get linearVelocity(){return Math.PI*this.panDiameter*this.panSpeedRPM}set linearVelocity(a){this.panSpeedRPM=a/(Math.PI*this.panDiameter)}get linearVelocityFPM(){return 3.28084*this.linearVelocity}get velocityVsSpeedData(){let a=[];for(let b=5;125>=b;b+=5)a.push({linearVelocityFPM:b,speedRPM:b/(3.28084*(Math.PI*this.panDiameter))});return a}toJSON(){return Object.assign({},this,{panSpeedString:this.panSpeedRPM.toFixed(2),linearVelocity:this.linearVelocity,linearVelocityFPM:this.linearVelocityFPM,velocityVsSpeedData:this.velocityVsSpeedData})}}